import React, { Component } from 'react'

export default class Affair extends Component {
  render() {
    return (
        <div>
  
          <div className="affair" key={el.id}>
            <h3>{el.data}</h3>
            <h4>{el.time}</h4>
            <p className="paragraph">{el.text}</p>
            <b>{el.checked ? 'Молодец' : 'Ждет выполнения...'}</b>
          </div>

      </div>
    )
  }
}
